import { useState} from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Main from "./pages/main/Main";
import Login from "./pages/mypage/Login";
import StorageList from "./pages/storage/StorageList";
import Logout from "./pages/mypage/Logout";
import DetaileStorage from "./pages/storage/DetaileStorage";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Main />}></Route>
          <Route path='/login' element={<Login isLoggedIn={isLoggedIn}/>}></Route>
          <Route path='/logout' element={<Logout isLoggedIn={isLoggedIn}/>}></Route>
          <Route path='/storagelist' element={<StorageList />}></Route>
          <Route path='/detailestorage' element={<DetaileStorage />}></Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
